import React, { useState } from "react";
import { Box, TextField, Button, Select, MenuItem, InputLabel } from "@material-ui/core";

const AddProduct = () => {
    const [age, setAge] = useState('');
    const handleChange = (event) => {
        setAge(event.target.value);
      };
    return (
        <div className='product'>
            <h1>Add Product</h1>
            <Box
                component="form"
                sx={{
                    '& > :not(style)': { m: 1, width: '25ch' },
                }}
                noValidate
                autoComplete="off"
            >
                <TextField type="text" className="outlined-basic" label="Name" varient="outlined" />
                <TextField type="text" className="outlined-basic" label="Price" varient="outlined" />
                <TextField type="text" className="outlined-basic" label="Category" varient="outlined" />
                <InputLabel id="demo-simple-select-label">Age</InputLabel>
                <Select
                    labelId="demo-simple-select-label"
                    id="demo-simple-select"
                    value={age}
                    label="Age"
                    onChange={handleChange}
                >
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                </Select>
            </Box>
        </div>
    )
}

export default AddProduct;
